<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>VRML Viewer - Three.js</title>
    <style>
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body { 
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
            background: #1a1a2e; 
            color: #eee;
            overflow: hidden;
        }
        #container { width: 100vw; height: 100vh; }
        
        #ui {
            position: fixed;
            top: 20px;
            left: 20px;
            z-index: 100;
            display: flex;
            flex-direction: column;
            gap: 10px;
        }
        
        .panel {
            background: rgba(20, 20, 40, 0.9);
            border: 1px solid rgba(100, 150, 255, 0.3);
            border-radius: 8px;
            padding: 15px;
            backdrop-filter: blur(10px);
        }
        
        h3 { 
            font-size: 14px; 
            margin-bottom: 10px; 
            color: #88aaff;
            text-transform: uppercase;
            letter-spacing: 1px;
        }
        
        .file-btn {
            display: block;
            width: 100%;
            padding: 10px 15px;
            margin: 5px 0;
            background: linear-gradient(135deg, #2a2a4a 0%, #1a1a3a 100%);
            border: 1px solid rgba(100, 150, 255, 0.2);
            border-radius: 6px;
            color: #ddd;
            cursor: pointer;
            font-size: 13px;
            text-align: left;
            transition: all 0.2s;
        }
        
        .file-btn:hover {
            background: linear-gradient(135deg, #3a3a6a 0%, #2a2a5a 100%);
            border-color: rgba(100, 150, 255, 0.5);
            transform: translateX(3px);
        }
        
        .file-btn.active {
            background: linear-gradient(135deg, #4466aa 0%, #3355aa 100%);
            border-color: #6688ff;
        }
        
        .file-btn .desc {
            font-size: 11px;
            color: #888;
            margin-top: 3px;
        }
        
        #info {
            position: fixed;
            bottom: 20px;
            left: 20px;
            z-index: 100;
        }
        
        #stats {
            font-size: 12px;
            color: #888;
            line-height: 1.6;
        }
        
        #loading {
            position: fixed;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            background: rgba(20, 20, 40, 0.95);
            padding: 30px 50px;
            border-radius: 12px;
            border: 1px solid rgba(100, 150, 255, 0.3);
            text-align: center;
            z-index: 200;
            display: none;
        }
        
        .spinner {
            width: 40px;
            height: 40px;
            border: 3px solid rgba(100, 150, 255, 0.2);
            border-top-color: #6688ff;
            border-radius: 50%;
            animation: spin 1s linear infinite;
            margin: 0 auto 15px;
        }
        
        @keyframes spin {
            to { transform: rotate(360deg); }
        }
        
        #controls-help {
            font-size: 11px;
            color: #666;
            margin-top: 15px;
        }
        
        #controls-help kbd {
            background: #333;
            padding: 2px 6px;
            border-radius: 3px;
            font-family: monospace;
        }
    </style>
</head>
<body>
    <div id="container"></div>
    
    <div id="ui">
        <div class="panel">
            <h3>VRML Files</h3>
            <button class="file-btn" data-file="Allworld.wrl">
                Allworld.wrl
                <div class="desc">Geographic scene with Zurich &amp; Earth</div>
            </button>
            <button class="file-btn" data-file="ch.wrl">
                ch.wrl
                <div class="desc">Swiss cantonal boundaries</div>
            </button>
            <button class="file-btn" data-file="citypcxs.wrl">
                citypcxs.wrl
                <div class="desc">3D Cyberport city zones</div>
            </button>
        </div>
        
        <div class="panel" id="controls-help">
            <kbd>Left drag</kbd> Rotate<br>
            <kbd>Right drag</kbd> Pan<br>
            <kbd>Scroll</kbd> Zoom<br>
            <kbd>R</kbd> Reset view
        </div>
    </div>
    
    <div class="panel" id="info">
        <div id="stats">Select a file to load...</div>
    </div>
    
    <div id="loading">
        <div class="spinner"></div>
        <div>Parsing VRML...</div>
    </div>

    <script type="importmap">
    {
        "imports": {
            "three": "https://cdn.jsdelivr.net/npm/three@0.160.0/build/three.module.js",
            "three/addons/": "https://cdn.jsdelivr.net/npm/three@0.160.0/examples/jsm/"
        }
    }
    </script>
    
    <script type="module">
        import * as THREE from 'three';
        import { OrbitControls } from 'three/addons/controls/OrbitControls.js';

        // ============ VRML PARSER ============
        class VRMLParser {
            constructor() {
                this.definitions = {};
                this.materialStack = [this.defaultMaterial()];
            }

            defaultMaterial() {
                return {
                    ambient: new THREE.Color(0.2, 0.2, 0.2),
                    diffuse: new THREE.Color(0.8, 0.8, 0.8),
                    specular: new THREE.Color(0, 0, 0),
                    emissive: new THREE.Color(0, 0, 0),
                    shininess: 0.2,
                    transparency: 0
                };
            }

            parse(text) {
                this.definitions = {};
                this.materialStack = [this.defaultMaterial()];
                
                // Remove comments
                text = text.replace(/#[^\n]*/g, '');
                
                const group = new THREE.Group();
                this.parseNode(text, group);
                return group;
            }

            tokenize(text) {
                const tokens = [];
                let current = '';
                let inString = false;
                
                for (let i = 0; i < text.length; i++) {
                    const char = text[i];
                    
                    if (char === '"') {
                        inString = !inString;
                        current += char;
                    } else if (inString) {
                        current += char;
                    } else if (char === '{') {
                        if (current.trim()) tokens.push(current.trim());
                        tokens.push('{');
                        current = '';
                    } else if (char === '}') {
                        if (current.trim()) tokens.push(current.trim());
                        tokens.push('}');
                        current = '';
                    } else if (char === '[') {
                        if (current.trim()) tokens.push(current.trim());
                        tokens.push('[');
                        current = '';
                    } else if (char === ']') {
                        if (current.trim()) tokens.push(current.trim());
                        tokens.push(']');
                        current = '';
                    } else if (/\s/.test(char)) {
                        if (current.trim()) tokens.push(current.trim());
                        current = '';
                    } else {
                        current += char;
                    }
                }
                if (current.trim()) tokens.push(current.trim());
                return tokens;
            }

            parseNode(text, parent) {
                const tokens = this.tokenize(text);
                let i = 0;
                
                while (i < tokens.length) {
                    const token = tokens[i];
                    
                    if (token === 'DEF') {
                        const name = tokens[++i];
                        const nodeType = tokens[++i];
                        if (tokens[++i] === '{') {
                            const content = this.extractBlock(tokens, i);
                            i = content.endIndex + 1;
                            const node = this.createNode(nodeType, content.text, parent);
                            if (node) {
                                this.definitions[name] = node;
                                if (node instanceof THREE.Object3D) {
                                    parent.add(node);
                                }
                            }
                        }
                    } else if (token === 'USE') {
                        const name = tokens[++i];
                        if (this.definitions[name]) {
                            const clone = this.definitions[name].clone();
                            parent.add(clone);
                        }
                        i++;
                    } else if (this.isNodeType(token)) {
                        if (tokens[i + 1] === '{') {
                            const content = this.extractBlock(tokens, i + 1);
                            i = content.endIndex + 1;
                            const node = this.createNode(token, content.text, parent);
                            if (node instanceof THREE.Object3D) {
                                parent.add(node);
                            }
                        } else {
                            i++;
                        }
                    } else {
                        i++;
                    }
                }
            }

            extractBlock(tokens, startIndex) {
                let depth = 1;
                let i = startIndex + 1;
                const parts = [];
                
                while (i < tokens.length && depth > 0) {
                    if (tokens[i] === '{') depth++;
                    else if (tokens[i] === '}') depth--;
                    
                    if (depth > 0) parts.push(tokens[i]);
                    i++;
                }
                
                return { text: parts.join(' '), endIndex: i - 1 };
            }

            isNodeType(token) {
                const nodeTypes = [
                    'Separator', 'Group', 'Transform', 'Material', 'Coordinate3', 
                    'IndexedFaceSet', 'IndexedLineSet', 'Cube', 'Sphere', 'Cylinder',
                    'Cone', 'AsciiText', 'FontStyle', 'Translation', 'Rotation', 
                    'Scale', 'LOD', 'Switch', 'ShapeHints', 'Normal', 'NormalBinding',
                    'Info', 'Label', 'PerspectiveCamera', 'DirectionalLight', 
                    'PointLight', 'SpotLight', 'Texture2', 'DrawStyle', 'Rotor'
                ];
                return nodeTypes.includes(token);
            }

            createNode(type, content, parent) {
                switch (type) {
                    case 'Separator':
                    case 'Group':
                        return this.parseSeparator(content);
                    case 'Transform':
                        return this.parseTransform(content, parent);
                    case 'Translation':
                        return this.parseTranslation(content, parent);
                    case 'Rotation':
                        return this.parseRotation(content, parent);
                    case 'Scale':
                        return this.parseScale(content, parent);
                    case 'Material':
                        this.parseMaterial(content);
                        return null;
                    case 'Coordinate3':
                        parent.userData.coordinates = this.parseCoordinate3(content);
                        return null;
                    case 'IndexedFaceSet':
                        return this.parseIndexedFaceSet(content, parent);
                    case 'IndexedLineSet':
                        return this.parseIndexedLineSet(content, parent);
                    case 'Cube':
                        return this.parseCube(content);
                    case 'Sphere':
                        return this.parseSphere(content);
                    case 'Cylinder':
                        return this.parseCylinder(content);
                    case 'Cone':
                        return this.parseCone(content);
                    case 'AsciiText':
                        return this.parseAsciiText(content);
                    case 'LOD':
                        return this.parseLOD(content, parent);
                    case 'Switch':
                        return this.parseSwitch(content, parent);
                    default:
                        return null;
                }
            }

            parseSeparator(content) {
                const group = new THREE.Group();
                group.userData.coordinates = null;
                this.parseNode(content, group);
                return group;
            }

            parseTransform(content, parent) {
                const group = new THREE.Group();
                group.userData.coordinates = parent?.userData?.coordinates || null;
                
                const translation = this.extractVector3(content, 'translation');
                const rotation = this.extractRotation(content, 'rotation');
                const scale = this.extractVector3(content, 'scaleFactor') || 
                             this.extractVector3(content, 'scale');
                
                if (translation) group.position.copy(translation);
                if (rotation) group.quaternion.copy(rotation);
                if (scale) group.scale.copy(scale);
                
                this.parseNode(content, group);
                return group;
            }

            parseTranslation(content, parent) {
                const group = new THREE.Group();
                group.userData.coordinates = parent?.userData?.coordinates || null;
                const translation = this.extractVector3(content, 'translation');
                if (translation) group.position.copy(translation);
                return group;
            }

            parseRotation(content, parent) {
                const group = new THREE.Group();
                group.userData.coordinates = parent?.userData?.coordinates || null;
                const rotation = this.extractRotation(content, 'rotation');
                if (rotation) group.quaternion.copy(rotation);
                return group;
            }

            parseScale(content, parent) {
                const group = new THREE.Group();
                group.userData.coordinates = parent?.userData?.coordinates || null;
                const scale = this.extractVector3(content, 'scaleFactor');
                if (scale) group.scale.copy(scale);
                return group;
            }

            parseMaterial(content) {
                const mat = { ...this.materialStack[this.materialStack.length - 1] };
                
                const ambient = this.extractColor(content, 'ambientColor');
                const diffuse = this.extractColor(content, 'diffuseColor');
                const specular = this.extractColor(content, 'specularColor');
                const emissive = this.extractColor(content, 'emissiveColor');
                const shininess = this.extractFloat(content, 'shininess');
                const transparency = this.extractFloat(content, 'transparency');
                
                if (ambient) mat.ambient = ambient;
                if (diffuse) mat.diffuse = diffuse;
                if (specular) mat.specular = specular;
                if (emissive) mat.emissive = emissive;
                if (shininess !== null) mat.shininess = shininess;
                if (transparency !== null) mat.transparency = transparency;
                
                this.materialStack[this.materialStack.length - 1] = mat;
            }

            parseCoordinate3(content) {
                const match = content.match(/point\s*\[\s*([\s\S]*?)\s*\]/);
                if (!match) return [];
                
                const coords = [];
                const numbers = match[1].match(/-?\d+\.?\d*(?:e[+-]?\d+)?/gi);
                
                if (numbers) {
                    for (let i = 0; i < numbers.length; i += 3) {
                        coords.push(new THREE.Vector3(
                            parseFloat(numbers[i]) || 0,
                            parseFloat(numbers[i + 1]) || 0,
                            parseFloat(numbers[i + 2]) || 0
                        ));
                    }
                }
                return coords;
            }

            parseIndexedFaceSet(content, parent) {
                const coords = this.findCoordinates(parent);
                if (!coords || coords.length === 0) return null;
                
                const match = content.match(/coordIndex\s*\[\s*([\s\S]*?)\s*\]/);
                if (!match) return null;
                
                const indices = match[1].match(/-?\d+/g)?.map(Number) || [];
                
                const geometry = new THREE.BufferGeometry();
                const vertices = [];
                const face = [];
                
                for (const idx of indices) {
                    if (idx === -1) {
                        for (let i = 1; i < face.length - 1; i++) {
                            vertices.push(...coords[face[0]].toArray());
                            vertices.push(...coords[face[i]].toArray());
                            vertices.push(...coords[face[i + 1]].toArray());
                        }
                        face.length = 0;
                    } else if (idx >= 0 && idx < coords.length) {
                        face.push(idx);
                    }
                }
                
                if (vertices.length === 0) return null;
                
                geometry.setAttribute('position', new THREE.Float32BufferAttribute(vertices, 3));
                geometry.computeVertexNormals();
                
                const mat = this.materialStack[this.materialStack.length - 1];
                const material = new THREE.MeshPhongMaterial({
                    color: mat.diffuse,
                    emissive: mat.emissive,
                    specular: mat.specular,
                    shininess: mat.shininess * 128,
                    transparent: mat.transparency > 0,
                    opacity: 1 - mat.transparency,
                    side: THREE.DoubleSide
                });
                
                return new THREE.Mesh(geometry, material);
            }

            parseIndexedLineSet(content, parent) {
                const coords = this.findCoordinates(parent);
                if (!coords || coords.length === 0) return null;
                
                const match = content.match(/coordIndex\s*\[\s*([\s\S]*?)\s*\]/);
                if (!match) return null;
                
                const indices = match[1].match(/-?\d+/g)?.map(Number) || [];
                
                const mat = this.materialStack[this.materialStack.length - 1];
                const material = new THREE.LineBasicMaterial({
                    color: mat.diffuse.clone().lerp(mat.emissive, 0.5),
                    transparent: mat.transparency > 0,
                    opacity: 1 - mat.transparency
                });
                
                const group = new THREE.Group();
                let linePoints = [];
                
                for (const idx of indices) {
                    if (idx === -1) {
                        if (linePoints.length >= 2) {
                            const geometry = new THREE.BufferGeometry().setFromPoints(linePoints);
                            group.add(new THREE.Line(geometry, material));
                        }
                        linePoints = [];
                    } else if (idx >= 0 && idx < coords.length) {
                        linePoints.push(coords[idx]);
                    }
                }
                
                if (linePoints.length >= 2) {
                    const geometry = new THREE.BufferGeometry().setFromPoints(linePoints);
                    group.add(new THREE.Line(geometry, material));
                }
                
                return group;
            }

            findCoordinates(node) {
                if (!node) return null;
                if (node.userData?.coordinates) return node.userData.coordinates;
                if (node.parent) return this.findCoordinates(node.parent);
                return null;
            }

            parseCube(content) {
                const width = this.extractFloat(content, 'width') || 2;
                const height = this.extractFloat(content, 'height') || 2;
                const depth = this.extractFloat(content, 'depth') || 2;
                
                const geometry = new THREE.BoxGeometry(width, height, depth);
                const mat = this.materialStack[this.materialStack.length - 1];
                const material = new THREE.MeshPhongMaterial({
                    color: mat.diffuse,
                    emissive: mat.emissive,
                    specular: mat.specular,
                    shininess: mat.shininess * 128,
                    transparent: mat.transparency > 0,
                    opacity: 1 - mat.transparency,
                    side: THREE.DoubleSide
                });
                
                return new THREE.Mesh(geometry, material);
            }

            parseSphere(content) {
                const radius = this.extractFloat(content, 'radius') || 1;
                
                const geometry = new THREE.SphereGeometry(radius, 32, 24);
                const mat = this.materialStack[this.materialStack.length - 1];
                const material = new THREE.MeshPhongMaterial({
                    color: mat.diffuse,
                    emissive: mat.emissive,
                    specular: mat.specular,
                    shininess: mat.shininess * 128,
                    transparent: mat.transparency > 0,
                    opacity: 1 - mat.transparency,
                    side: THREE.DoubleSide
                });
                
                return new THREE.Mesh(geometry, material);
            }

            parseCylinder(content) {
                const radius = this.extractFloat(content, 'radius') || 1;
                const height = this.extractFloat(content, 'height') || 2;
                const partsMatch = content.match(/parts\s+(\w+)/);
                const sidesOnly = partsMatch && partsMatch[1] === 'SIDES';
                
                const geometry = new THREE.CylinderGeometry(
                    radius, radius, height, 32, 1, sidesOnly
                );
                const mat = this.materialStack[this.materialStack.length - 1];
                const material = new THREE.MeshPhongMaterial({
                    color: mat.diffuse,
                    emissive: mat.emissive,
                    specular: mat.specular,
                    shininess: mat.shininess * 128,
                    transparent: mat.transparency > 0,
                    opacity: 1 - mat.transparency,
                    side: THREE.DoubleSide
                });
                
                return new THREE.Mesh(geometry, material);
            }

            parseCone(content) {
                const bottomRadius = this.extractFloat(content, 'bottomRadius') || 1;
                const height = this.extractFloat(content, 'height') || 2;
                
                const geometry = new THREE.ConeGeometry(bottomRadius, height, 32);
                const mat = this.materialStack[this.materialStack.length - 1];
                const material = new THREE.MeshPhongMaterial({
                    color: mat.diffuse,
                    emissive: mat.emissive,
                    side: THREE.DoubleSide
                });
                
                return new THREE.Mesh(geometry, material);
            }

            parseAsciiText(content) {
                const stringMatch = content.match(/string\s*(?:\[\s*)?"([^"]+)"/);
                if (!stringMatch) return null;
                
                const text = stringMatch[1];
                const group = new THREE.Group();
                
                const canvas = document.createElement('canvas');
                const ctx = canvas.getContext('2d');
                canvas.width = 512;
                canvas.height = 128;
                
                ctx.fillStyle = 'rgba(0,0,0,0)';
                ctx.fillRect(0, 0, canvas.width, canvas.height);
                
                const mat = this.materialStack[this.materialStack.length - 1];
                const color = mat.emissive.getHexString() !== '000000' ? 
                    mat.emissive : mat.diffuse;
                
                ctx.fillStyle = '#' + color.getHexString();
                ctx.font = 'bold 48px sans-serif';
                ctx.textAlign = 'center';
                ctx.textBaseline = 'middle';
                ctx.fillText(text, canvas.width / 2, canvas.height / 2);
                
                const texture = new THREE.CanvasTexture(canvas);
                texture.minFilter = THREE.LinearFilter;
                
                const spriteMaterial = new THREE.SpriteMaterial({ 
                    map: texture,
                    transparent: true
                });
                const sprite = new THREE.Sprite(spriteMaterial);
                sprite.scale.set(20, 5, 1);
                
                group.add(sprite);
                return group;
            }

            parseLOD(content, parent) {
                const group = new THREE.Group();
                group.userData.coordinates = parent?.userData?.coordinates || null;
                this.parseNode(content, group);
                return group;
            }

            parseSwitch(content, parent) {
                const group = new THREE.Group();
                group.userData.coordinates = parent?.userData?.coordinates || null;
                this.parseNode(content, group);
                return group;
            }

            extractVector3(content, name) {
                const regex = new RegExp(name + '\\s+(-?[\\d.e+-]+)\\s+(-?[\\d.e+-]+)\\s+(-?[\\d.e+-]+)', 'i');
                const match = content.match(regex);
                if (match) {
                    return new THREE.Vector3(
                        parseFloat(match[1]),
                        parseFloat(match[2]),
                        parseFloat(match[3])
                    );
                }
                return null;
            }

            extractRotation(content, name) {
                const regex = new RegExp(name + '\\s+(-?[\\d.e+-]+)\\s+(-?[\\d.e+-]+)\\s+(-?[\\d.e+-]+)\\s+(-?[\\d.e+-]+)', 'i');
                const match = content.match(regex);
                if (match) {
                    const axis = new THREE.Vector3(
                        parseFloat(match[1]),
                        parseFloat(match[2]),
                        parseFloat(match[3])
                    ).normalize();
                    const angle = parseFloat(match[4]);
                    return new THREE.Quaternion().setFromAxisAngle(axis, angle);
                }
                return null;
            }

            extractColor(content, name) {
                const regex = new RegExp(name + '\\s+(-?[\\d.e+-]+)\\s+(-?[\\d.e+-]+)\\s+(-?[\\d.e+-]+)', 'i');
                const match = content.match(regex);
                if (match) {
                    return new THREE.Color(
                        parseFloat(match[1]),
                        parseFloat(match[2]),
                        parseFloat(match[3])
                    );
                }
                return null;
            }

            extractFloat(content, name) {
                const regex = new RegExp(name + '\\s+(-?[\\d.e+-]+)', 'i');
                const match = content.match(regex);
                return match ? parseFloat(match[1]) : null;
            }
        }

        // ============ VRML DATA LOADER ============
        const vrmlData = {};
        
        function loadEmbeddedData() {
            const files = ['Allworld.wrl', 'ch.wrl', 'citypcxs.wrl'];
            files.forEach(file => {
                const script = document.getElementById('vrml-' + file);
                if (script) {
                    const base64 = script.textContent.trim();
                    vrmlData[file] = atob(base64);
                }
            });
        }

        // ============ MAIN APPLICATION ============
        class VRMLViewer {
            constructor() {
                this.container = document.getElementById('container');
                this.parser = new VRMLParser();
                this.currentFile = null;
                
                loadEmbeddedData();
                this.init();
                this.setupUI();
                this.animate();
                
                this.loadFile('Allworld.wrl');
            }

            init() {
                this.scene = new THREE.Scene();
                this.scene.background = new THREE.Color(0x0a0a1a);
                
                this.camera = new THREE.PerspectiveCamera(
                    60, window.innerWidth / window.innerHeight, 0.1, 100000
                );
                this.camera.position.set(500, 500, 500);
                
                this.renderer = new THREE.WebGLRenderer({ antialias: true });
                this.renderer.setSize(window.innerWidth, window.innerHeight);
                this.renderer.setPixelRatio(Math.min(window.devicePixelRatio, 2));
                this.container.appendChild(this.renderer.domElement);
                
                this.controls = new OrbitControls(this.camera, this.renderer.domElement);
                this.controls.enableDamping = true;
                this.controls.dampingFactor = 0.05;
                
                const ambientLight = new THREE.AmbientLight(0x404060, 0.5);
                this.scene.add(ambientLight);
                
                const directionalLight = new THREE.DirectionalLight(0xffffff, 1);
                directionalLight.position.set(1, 1, 1);
                this.scene.add(directionalLight);
                
                const directionalLight2 = new THREE.DirectionalLight(0x8888ff, 0.5);
                directionalLight2.position.set(-1, -0.5, -1);
                this.scene.add(directionalLight2);
                
                this.gridHelper = new THREE.GridHelper(1000, 50, 0x444466, 0x222244);
                this.scene.add(this.gridHelper);
                
                window.addEventListener('resize', () => this.onResize());
                
                window.addEventListener('keydown', (e) => {
                    if (e.key === 'r' || e.key === 'R') {
                        this.resetCamera();
                    }
                });
            }

            setupUI() {
                document.querySelectorAll('.file-btn').forEach(btn => {
                    btn.addEventListener('click', () => {
                        const file = btn.dataset.file;
                        this.loadFile(file);
                    });
                });
            }

            loadFile(filename) {
                document.getElementById('loading').style.display = 'block';
                
                document.querySelectorAll('.file-btn').forEach(btn => {
                    btn.classList.toggle('active', btn.dataset.file === filename);
                });
                
                setTimeout(() => {
                    try {
                        const text = vrmlData[filename];
                        if (!text) throw new Error('File not found: ' + filename);
                        
                        if (this.currentModel) {
                            this.scene.remove(this.currentModel);
                            this.disposeObject(this.currentModel);
                        }
                        
                        this.currentModel = this.parser.parse(text);
                        this.scene.add(this.currentModel);
                        
                        this.fitCameraToObject(this.currentModel);
                        this.updateStats(filename);
                        
                        this.currentFile = filename;
                    } catch (error) {
                        console.error('Error loading file:', error);
                        document.getElementById('stats').textContent = 'Error: ' + error.message;
                    }
                    
                    document.getElementById('loading').style.display = 'none';
                }, 50);
            }

            fitCameraToObject(object) {
                const box = new THREE.Box3().setFromObject(object);
                const size = box.getSize(new THREE.Vector3());
                const center = box.getCenter(new THREE.Vector3());
                
                const maxDim = Math.max(size.x, size.y, size.z);
                const fov = this.camera.fov * (Math.PI / 180);
                let cameraZ = Math.abs(maxDim / 2 / Math.tan(fov / 2));
                cameraZ *= 1.5;
                
                this.camera.position.set(
                    center.x + cameraZ * 0.5,
                    center.y + cameraZ * 0.5,
                    center.z + cameraZ
                );
                
                this.camera.near = maxDim / 1000;
                this.camera.far = maxDim * 100;
                this.camera.updateProjectionMatrix();
                
                this.controls.target.copy(center);
                this.controls.update();
                
                this.gridHelper.scale.setScalar(maxDim / 500);
                this.gridHelper.position.y = box.min.y;
            }

            resetCamera() {
                if (this.currentModel) {
                    this.fitCameraToObject(this.currentModel);
                }
            }

            updateStats(filename) {
                let meshCount = 0;
                let lineCount = 0;
                let vertexCount = 0;
                
                this.currentModel.traverse(obj => {
                    if (obj instanceof THREE.Mesh) {
                        meshCount++;
                        if (obj.geometry.attributes.position) {
                            vertexCount += obj.geometry.attributes.position.count;
                        }
                    } else if (obj instanceof THREE.Line) {
                        lineCount++;
                        if (obj.geometry.attributes.position) {
                            vertexCount += obj.geometry.attributes.position.count;
                        }
                    }
                });
                
                document.getElementById('stats').innerHTML = 
                    '<strong>' + filename + '</strong><br>' +
                    'Meshes: ' + meshCount.toLocaleString() + '<br>' +
                    'Lines: ' + lineCount.toLocaleString() + '<br>' +
                    'Vertices: ' + vertexCount.toLocaleString();
            }

            disposeObject(obj) {
                obj.traverse(child => {
                    if (child.geometry) child.geometry.dispose();
                    if (child.material) {
                        if (Array.isArray(child.material)) {
                            child.material.forEach(m => m.dispose());
                        } else {
                            child.material.dispose();
                        }
                    }
                });
            }

            onResize() {
                this.camera.aspect = window.innerWidth / window.innerHeight;
                this.camera.updateProjectionMatrix();
                this.renderer.setSize(window.innerWidth, window.innerHeight);
            }

            animate() {
                requestAnimationFrame(() => this.animate());
                this.controls.update();
                this.renderer.render(this.scene, this.camera);
            }
        }

        new VRMLViewer();
    </script>
</body>
</html>
